import hashlib
import struct
import binascii

hashes = ""

prefixes = [hashes[i:i+8] for i in range(0, len(hashes), 64)]
print(prefixes)
# assert len(prefixes) == 32
prefix_list = set(prefixes)

for i in range(1 << 32):
  s = struct.pack('<I', i)
  q = hashlib.sha3_256(s).hexdigest()[0:8]
  if q in prefix_list:
    print('DINGDINGDING')
    print(s)
    print(i)
    break
  if i % 10000 == 0:
    print(i)